public class ModelData {
	public List<Integer> states;
	public Map<Integer, List<Integer>> successors;
	public Map<Integer, List<Label>> labels;

	public ModelData() {
		states = new ArrayList<>();
		successors = new HashMap<>();
		labels = new HashMap<>();
	}

	public ModelData addStates(int... n) {
		for (int nn : n) {
			states.add(nn);
			successors.put(nn, new ArrayList<>());
			labels.put(nn, new ArrayList<>());
		}

		return this;
	}

	public ModelData addTransition(int from, int to) {
		successors.get(from).add(to);
		return this;
	}

	public ModelData addLabel(int state, Label label) {
		labels.get(state).add(label);
		return this;
	}

	public List<Integer> getStates() {
		return states;
	}

	public List<Integer> getSuccessors(int state) {
		return successors.get(state);
	}

	public List<Label> getLabels(int state) {
		return labels.get(state);
	}
}
